SELECT "Generico_5"."Anunciante" AS "Datos (copia)",   "Generico_5"."Medio" AS "Medio",   SUM("Generico_5"."InversionUS") AS "sum:Calculation_0061002123102817:ok" FROM "Generico_5" WHERE (("Generico_5"."Anunciante" IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) >= 2010) AND (CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) <= 2015) AND (CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) IN (2014, 2015))) GROUP BY "Generico_5"."Anunciante",   "Generico_5"."Medio" ORDER BY "Datos (copia)";
